import React from 'react';
import { Box, Typography } from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import WorkOutlineIcon from '@mui/icons-material/WorkOutline';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import FlagIcon from '@mui/icons-material/Flag';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import AccessTimeIcon from '@mui/icons-material/AccessTime';

const Timeline = ({ prediction, profile }) => {
  if (!prediction) return null;

  // Werte berechnen
  const confidenceValue = Array.isArray(prediction.confidence) ? prediction.confidence[0] : prediction.confidence;
  const tageBisWechsel = Math.round(confidenceValue);
  const heute = new Date();
  const wechselDatum = new Date(heute.getTime() + tageBisWechsel * 24 * 60 * 60 * 1000);

  // Phasen berechnen
  const tageBisBewerbung = Math.round(tageBisWechsel * 0.3);
  const tageBisIntensiveSuche = Math.round(tageBisWechsel * 0.7);
  const bewerbungsDatum = new Date(heute.getTime() + tageBisBewerbung * 24 * 60 * 60 * 1000);
  const intensiveSucheDatum = new Date(heute.getTime() + tageBisIntensiveSuche * 24 * 60 * 60 * 1000);

  // Aktuelle Position und Dauer
  let aktuellePosition = '';
  let dauerJahre = '';
  if (profile && profile.experience && profile.experience.length > 0) {
    aktuellePosition = profile.experience[0].title || '';
    const start = profile.experience[0].startDate ? new Date(profile.experience[0].startDate) : null;
    const end = profile.experience[0].endDate === 'Present' || !profile.experience[0].endDate ? heute : new Date(profile.experience[0].endDate);
    if (start) {
      const diff = (end - start) / (1000 * 60 * 60 * 24 * 365.25);
      dauerJahre = diff > 0 ? diff.toFixed(1) : '';
    }
  }

  // Timeline-Phasen
  const phases = [
    {
      icon: <PersonIcon sx={{ fontSize: 32, color: '#3B82F6' }} />,
      label: 'Heute',
      desc: 'Wechselbereitschaft erkannt',
      date: heute.toLocaleDateString('de-DE', { day: '2-digit', month: 'short', year: 'numeric' }),
      color: '#3B82F6'
    },
    {
      icon: <WorkOutlineIcon sx={{ fontSize: 32, color: '#F59E42' }} />,
      label: `In ca. ${tageBisBewerbung} Tagen`,
      desc: 'Erste BewerbungsaktivitÃ¤ten erwartet',
      date: bewerbungsDatum.toLocaleDateString('de-DE', { day: '2-digit', month: 'short', year: 'numeric' }),
      color: '#F59E42'
    },
    {
      icon: <TrendingUpIcon sx={{ fontSize: 32, color: '#F59E42' }} />,
      label: `In ca. ${tageBisIntensiveSuche} Tagen`,
      desc: 'Intensive Jobsuche-Phase',
      date: intensiveSucheDatum.toLocaleDateString('de-DE', { day: '2-digit', month: 'short', year: 'numeric' }),
      color: '#F59E42'
    },
    {
      icon: <FlagIcon sx={{ fontSize: 32, color: '#F87171' }} />,
      label: wechselDatum.toLocaleDateString('de-DE', { day: '2-digit', month: 'short', year: 'numeric' }),
      desc: 'Voraussichtlicher Jobwechsel',
      date: wechselDatum.toLocaleDateString('de-DE', { day: '2-digit', month: 'short', year: 'numeric' }),
      color: '#F87171'
    }
  ];

  return (
    <Box sx={{ width: '100%', my: 0, p: 1, display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 4, position: 'relative', overflow: 'visible' }}>
      {/* ErklÃ¤rung Ã¼ber der Timeline */}
      <Box sx={{ width: '100%', mb: 2 }}>
        <Typography variant="h6" sx={{ fontWeight: 700, color: '#13213C', mb: 1, fontSize: '1.5rem' }}>
          Career Change Prediction Timeline
        </Typography>
        <Typography sx={{ color: '#444', fontSize: '1rem', lineHeight: 1.7 }}>
          This timeline visualizes the predicted career change process for the candidate. It shows the current status, the expected start of job search activities, the phase of intensive job seeking, and the estimated date of the next job change. The boxes below provide additional details about the time remaining and the current position.
        </Typography>
      </Box>
      {/* Timeline */}
      <Box sx={{ width: '100%', maxWidth: 1200, mb: 4, position: 'relative' }}>
        {/* Linie */}
        <Box sx={{
          position: 'absolute',
          top: 36,
          left: 0,
          right: 0,
          height: 6,
          background: 'linear-gradient(90deg, #3B82F6 0%, #F59E42 50%, #F87171 100%)',
          borderRadius: 3,
          zIndex: 1
        }} />
        {/* Phasen */}
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', position: 'relative', zIndex: 2 }}>
          {phases.map((phase, idx) => (
            <Box key={idx} sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', minWidth: 180 }}>
              <Box sx={{
                bgcolor: '#fff',
                borderRadius: 3,
                boxShadow: '0 4px 16px #0001',
                p: 2,
                mb: 1,
                mt: 0,
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                minWidth: 70,
                minHeight: 70
              }}>
                {phase.icon}
              </Box>
              <Typography sx={{ fontWeight: 700, fontSize: '1.1rem', color: phase.color, mb: 0.2 }}>{phase.label}</Typography>
              <Typography sx={{ fontWeight: 400, fontSize: '0.95rem', color: '#222', mb: 0.2 }}>{phase.desc}</Typography>
              <Typography sx={{ fontWeight: 400, fontSize: '0.9rem', color: '#888' }}>{phase.date}</Typography>
            </Box>
          ))}
        </Box>
      </Box>
      {/* Untere KÃ¤stchen */}
      <Box sx={{ display: 'flex', gap: 4, width: '100%', maxWidth: 900, justifyContent: 'center', mt: 2 }}>
        {/* Tage bis Wechsel */}
        <Box sx={{
          bgcolor: '#F5FAFF',
          border: '1.5px solid #3B82F6',
          borderRadius: 4,
          p: 4,
          minWidth: 220,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          boxShadow: '0 2px 8px #3B82F622'
        }}>
          <CalendarTodayIcon sx={{ fontSize: 36, color: '#3B82F6', mb: 1 }} />
          <Typography sx={{ fontWeight: 800, fontSize: 32, color: '#2563EB', mb: 0.5 }}>{tageBisWechsel}</Typography>
          <Typography sx={{ fontWeight: 500, fontSize: 16, color: '#2563EB' }}>Tage bis Wechsel</Typography>
        </Box>
        {/* Aktuelle Position */}
        <Box sx={{
          bgcolor: '#FFF7F0',
          border: '1.5px solid #F59E42',
          borderRadius: 4,
          p: 4,
          minWidth: 220,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          boxShadow: '0 2px 8px #F59E4222'
        }}>
          <AccessTimeIcon sx={{ fontSize: 36, color: '#F59E42', mb: 1 }} />
          <Typography sx={{ fontWeight: 800, fontSize: 28, color: '#B45309', mb: 0.5 }}>
            {dauerJahre ? `${dauerJahre} Jahre` : 'â'}
          </Typography>
          <Typography sx={{ fontWeight: 500, fontSize: 16, color: '#B45309', mb: 0.5 }}>
            Aktuelle Position
          </Typography>
          <Typography sx={{ fontWeight: 600, fontSize: 16, color: '#B45309' }}>
            {aktuellePosition || 'â'}
          </Typography>
        </Box>
      </Box>
    </Box>
  );
};

export default Timeline;
